import React, { useEffect, useState } from "react";
import { getUsers } from "../api";

const UserList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getUsers()
      .then((data) => {
        setUsers(data);
      })
      .catch((error) => {
        console.error("Error fetching users:", error);
      });
  }, []);

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.map((u) => (
          <li key={u._id}>
            {u.name}
            {u.email ? ` (${u.email})` : ""}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UserList;
